import React, { useState } from 'react';
import styles from './SubmissionPage.module.css';

const mockData = Array.from({ length: 42 }, (_, i) => ({
    id: i + 1,
    name: `홍길동${i + 1}`,
    studentId: `2020011${i}`,
    title: `[장학금 신청서_2020011${i}_홍길동${i + 1}].pdf`,
    date: `2025.04.${(i % 30 + 1).toString().padStart(2, '0')}`,
    status: i % 3 === 0 ? '신규 등록' : i % 3 === 1 ? '반려 처리' : '승인 완료',
}));

const SubmissionPage = () => {
    const [filters, setFilters] = useState({
        title: '',
        startDate: '',
        endDate: '',
        types: [],
        approval: '',
    });

    const [currentPage, setCurrentPage] = useState(1);
    const itemsPerPage = 10;

    const handleFilterChange = (e) => {
        const { name, value, type, checked } = e.target;
        if (type === 'checkbox') {
            setFilters((prev) => ({
                ...prev,
                types: checked
                    ? [...prev.types, value]
                    : prev.types.filter((v) => v !== value),
            }));
        } else if (name === 'approval') {
            setFilters((prev) => ({ ...prev, approval: value }));
        } else {
            setFilters((prev) => ({ ...prev, [name]: value }));
        }
    };

    const filtered = mockData.filter((item) => {
        const matchTitle = item.title.includes(filters.title);
        const matchStart = !filters.startDate || item.date >= filters.startDate;
        const matchEnd = !filters.endDate || item.date <= filters.endDate;
        const matchType =
            filters.types.length === 0 || filters.types.includes(item.status);
        const matchApproval =
            !filters.approval || (filters.approval === 'Y' ? item.status === '승인 완료' : item.status !== '승인 완료');
        return matchTitle && matchStart && matchEnd && matchType && matchApproval;
    });

    const paged = filtered.slice((currentPage - 1) * itemsPerPage, currentPage * itemsPerPage);
    const totalPages = Math.ceil(filtered.length / itemsPerPage);

    return (
        <div className={styles.page}>
            <h3 className={styles.selectedDept}>▶ 학적 | 학사지원과</h3>

            <div className={styles.filterContainer}>
                <input
                    name="title"
                    placeholder="서류 제목"
                    value={filters.title}
                    onChange={handleFilterChange}
                />
                <input
                    type="date"
                    name="startDate"
                    value={filters.startDate}
                    onChange={handleFilterChange}
                />
                <input
                    type="date"
                    name="endDate"
                    value={filters.endDate}
                    onChange={handleFilterChange}
                />
                <label><input type="checkbox" value="신규 등록" onChange={handleFilterChange} /> 신규 등록</label>
                <label><input type="checkbox" value="반려 처리" onChange={handleFilterChange} /> 반려 처리</label>
                <label><input type="checkbox" value="승인 완료" onChange={handleFilterChange} /> 승인 완료</label>
                <label><input type="radio" name="approval" value="Y" onChange={handleFilterChange} /> Y</label>
                <label><input type="radio" name="approval" value="N" onChange={handleFilterChange} /> N</label>
                <button onClick={() => setCurrentPage(1)}>검색</button>
            </div>

            <table className={styles.table}>
                <thead>
                <tr>
                    <th>번호</th>
                    <th>이름</th>
                    <th>학번</th>
                    <th>서류 제목</th>
                    <th>서류 제출일자</th>
                    <th>구분</th>
                </tr>
                </thead>
                <tbody>
                {paged.map((item, idx) => (
                    <tr key={item.id}>
                        <td>{(currentPage - 1) * itemsPerPage + idx + 1}</td>
                        <td>{item.name}</td>
                        <td>{item.studentId}</td>
                        <td>{item.title}</td>
                        <td>{item.date}</td>
                        <td style={{ color: item.status === '승인 완료' ? 'red' : undefined }}>{item.status}</td>
                    </tr>
                ))}
                </tbody>
            </table>

            <div className={styles.pagination}>
                {Array.from({ length: totalPages }, (_, i) => (
                    <button
                        key={i}
                        className={i + 1 === currentPage ? styles.activePage : ''}
                        onClick={() => setCurrentPage(i + 1)}
                    >
                        {i + 1}
                    </button>
                ))}
            </div>
        </div>
    );
};

export default SubmissionPage;
